import React from 'react'

function Layout({menu, body}) {
  return (
    <>
      <div id='navbar'><h3>Gallifrey</h3></div>
      {body}
      <div className='footer'>
        Gallifrey 4.0.0<br />
        Developed By <a href='mailto:nick.p@iinet.net.au'>Nick Patrikeos</a>.
      </div>
    </>
  );
}
